import { format, formatDistanceToNow } from "date-fns";
import {
    Activity,
    AlertTriangle,
    BarChart3,
    CheckCircle,
    Clock,
    Copy,
    Download,
    Edit3,
    ExternalLink,
    Eye,
    FileText,
    Globe,
    Lock,
    MoreVertical,
    Plus,
    Search,
    Settings,
    Share2,
    Target,
    Trash2,
    TrendingUp,
    Users,
    XCircle,
    Zap,
} from "lucide-react";
import { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { toast } from "react-toastify";
import LoadingSpinner from "../components/UI/LoadingSpinner";
import { useAuth } from "../contexts/AuthContext";
import { useForm } from "../contexts/FormContext";

const Dashboard = () => {
  const { user } = useAuth();
  const {
    forms,
    loading,
    getForms,
    deleteForm,
    duplicateForm,
    publishForm,
    exportResponses,
  } = useForm();

  const navigate = useNavigate();

  const [searchTerm, setSearchTerm] = useState("");
  const [statusFilter, setStatusFilter] = useState("all");
  const [sortBy, setSortBy] = useState("updatedAt");
  const [sortOrder, setSortOrder] = useState("desc");
  const [viewMode, setViewMode] = useState("grid"); // 'grid' or 'list'
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [showDuplicateModal, setShowDuplicateModal] = useState(false);
  const [showShareModal, setShowShareModal] = useState(false);
  const [selectedForm, setSelectedForm] = useState(null);
  const [duplicateTitle, setDuplicateTitle] = useState("");
  const [isExporting, setIsExporting] = useState(false);

  useEffect(() => {
    loadForms();
  }, []);

  const loadForms = async () => {
    try {
      await getForms();
    } catch (error) {
      console.error("Failed to load forms:", error);
      toast.error("Failed to load forms");
    }
  };

  const filteredAndSortedForms = forms
    .filter((form) => {
      const matchesSearch =
        form.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
        form.description?.toLowerCase().includes(searchTerm.toLowerCase());

      const matchesStatus =
        statusFilter === "all" ||
        (statusFilter === "published" && form.isPublished && form.isActive) ||
        (statusFilter === "draft" && !form.isPublished) ||
        (statusFilter === "inactive" && !form.isActive);

      return matchesSearch && matchesStatus;
    })
    .sort((a, b) => {
      let aValue = a[sortBy];
      let bValue = b[sortBy];

      if (sortBy === "title") {
        aValue = aValue.toLowerCase();
        bValue = bValue.toLowerCase();
      } else if (sortBy === "updatedAt" || sortBy === "createdAt") {
        aValue = new Date(aValue);
        bValue = new Date(bValue);
      } else if (sortBy === "responses") {
        aValue = a.stats?.totalSubmissions || 0;
        bValue = b.stats?.totalSubmissions || 0;
      } else if (sortBy === "views") {
        aValue = a.stats?.totalViews || 0;
        bValue = b.stats?.totalViews || 0;
      }

      if (sortOrder === "asc") {
        return aValue > bValue ? 1 : -1;
      } else {
        return aValue < bValue ? 1 : -1;
      }
    });

  const handleDeleteForm = async () => {
    if (!selectedForm) return;

    try {
      await deleteForm(selectedForm._id);
      setShowDeleteModal(false);
      setSelectedForm(null);
      toast.success("Form deleted successfully");
    } catch (error) {
      console.error("Failed to delete form:", error);
      toast.error("Failed to delete form");
    }
  };

  const handleDuplicateForm = async () => {
    if (!selectedForm || !duplicateTitle.trim()) return;

    try {
      const newForm = await duplicateForm(selectedForm._id, duplicateTitle);
      setShowDuplicateModal(false);
      setSelectedForm(null);
      setDuplicateTitle("");
      toast.success("Form duplicated successfully");
      navigate(`/forms/${newForm._id}/edit`);
    } catch (error) {
      console.error("Failed to duplicate form:", error);
      toast.error("Failed to duplicate form");
    }
  };

  const handlePublishToggle = async (form) => {
    try {
      await publishForm(form._id, !form.isPublished);
      toast.success(
        `Form ${!form.isPublished ? "published" : "unpublished"} successfully`
      );
    } catch (error) {
      console.error("Failed to toggle publish status:", error);
      toast.error("Failed to update form status");
    }
  };

  const handleExportResponses = async (formId, format) => {
    setIsExporting(true);
    try {
      await exportResponses(formId, format);
      toast.success(`Responses exported as ${format.toUpperCase()}`);
    } catch (error) {
      console.error("Export failed:", error);
      toast.error("Failed to export responses");
    } finally {
      setIsExporting(false);
    }
  };

  const handleShareForm = (form) => {
    setSelectedForm(form);
    setShowShareModal(true);
  };

  const copyShareLink = async (form) => {
    const shareUrl = `${window.location.origin}/form/${form._id}`;
    try {
      await navigator.clipboard.writeText(shareUrl);
      toast.success("Share link copied to clipboard!");
    } catch (error) {
      console.error("Failed to copy:", error);
      toast.error("Failed to copy link");
    }
  };

  const getStatusBadge = (form) => {
    if (!form.isActive) {
      return (
        <span className="badge badge-gray">
          <Lock className="w-3 h-3 mr-1" />
          Inactive
        </span>
      );
    }
    if (form.isPublished) {
      return (
        <span className="badge badge-success">
          <Globe className="w-3 h-3 mr-1" />
          Published
        </span>
      );
    }
    return (
      <span className="badge badge-warning">
        <FileText className="w-3 h-3 mr-1" />
        Draft
      </span>
    );
  };

  const getFormStatusIcon = (form) => {
    if (!form.isActive) return <XCircle className="w-5 h-5 text-red-500" />;
    if (form.isPublished)
      return <CheckCircle className="w-5 h-5 text-green-500" />;
    return <AlertTriangle className="w-5 h-5 text-yellow-500" />;
  };

  // Calculate dashboard stats
  const totalViews = forms.reduce(
    (sum, form) => sum + (form.stats?.totalViews || 0),
    0
  );
  const totalSubmissions = forms.reduce(
    (sum, form) => sum + (form.stats?.totalSubmissions || 0),
    0
  );
  const publishedForms = forms.filter(
    (form) => form.isPublished && form.isActive
  ).length;
  const avgConversionRate =
    forms.length > 0
      ? forms.reduce(
          (sum, form) => sum + (form.stats?.conversionRate || 0),
          0
        ) / forms.length
      : 0;

  const recentActivity = forms
    .sort((a, b) => new Date(b.updatedAt) - new Date(a.updatedAt))
    .slice(0, 5);

  if (loading && forms.length === 0) {
    return (
      <div className="flex items-center justify-center py-12">
        <LoadingSpinner size="lg" text="Loading your workspace..." />
      </div>
    );
  }

  return (
    <div className="space-y-8">
      {/* Welcome Section */}
      <div className="bg-gradient-to-r from-primary-500 via-purple-600 to-pink-500 rounded-2xl p-8 text-white relative overflow-hidden">
        <div className="absolute inset-0 bg-black/10"></div>
        <div className="relative z-10">
          <div className="flex items-center justify-between">
            <div className="space-y-2">
              <h1 className="text-3xl font-bold">
                Welcome back, {user?.profile?.name?.split(" ")[0] || "Builder"}!
                👋
              </h1>
              <p className="text-white/90 text-lg">
                {forms.length === 0
                  ? "Ready to create your first amazing form?"
                  : `You have ${forms.length} form${
                      forms.length !== 1 ? "s" : ""
                    } in your workspace`}
              </p>
              <div className="flex items-center space-x-6 text-sm">
                <div className="flex items-center">
                  <Eye className="w-4 h-4 mr-1" />
                  <span>{totalViews.toLocaleString()} total views</span>
                </div>
                <div className="flex items-center">
                  <Users className="w-4 h-4 mr-1" />
                  <span>{totalSubmissions.toLocaleString()} submissions</span>
                </div>
                <div className="flex items-center">
                  <Target className="w-4 h-4 mr-1" />
                  <span>{avgConversionRate.toFixed(1)}% avg conversion</span>
                </div>
              </div>
            </div>
            <div className="flex space-x-3">
              <Link
                to="/forms/new"
                className="btn bg-white text-primary-600 hover:bg-white/90 border-0 shadow-lg"
              >
                <Plus className="h-5 w-5 mr-2" />
                Create Form
              </Link>
            </div>
          </div>
        </div>
      </div>

      {/* Quick Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <div className="card hover:shadow-medium transition-shadow">
          <div className="card-body">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-medium text-gray-500">Total Forms</p>
                <p className="text-3xl font-bold text-gray-900">
                  {forms.length}
                </p>
                <p className="text-xs text-gray-400 mt-1">
                  {publishedForms} published
                </p>
              </div>
              <div className="bg-primary-100 p-3 rounded-lg">
                <FileText className="h-8 w-8 text-primary-600" />
              </div>
            </div>
          </div>
        </div>

        <div className="card hover:shadow-medium transition-shadow">
          <div className="card-body">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-medium text-gray-500">Total Views</p>
                <p className="text-3xl font-bold text-gray-900">
                  {totalViews.toLocaleString()}
                </p>
                <p className="text-xs text-gray-400 mt-1">Across all forms</p>
              </div>
              <div className="bg-blue-100 p-3 rounded-lg">
                <Eye className="h-8 w-8 text-blue-600" />
              </div>
            </div>
          </div>
        </div>

        <div className="card hover:shadow-medium transition-shadow">
          <div className="card-body">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-medium text-gray-500">Submissions</p>
                <p className="text-3xl font-bold text-gray-900">
                  {totalSubmissions.toLocaleString()}
                </p>
                <p className="text-xs text-gray-400 mt-1">Total responses</p>
              </div>
              <div className="bg-green-100 p-3 rounded-lg">
                <Users className="h-8 w-8 text-green-600" />
              </div>
            </div>
          </div>
        </div>

        <div className="card hover:shadow-medium transition-shadow">
          <div className="card-body">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-medium text-gray-500">
                  Conversion Rate
                </p>
                <p className="text-3xl font-bold text-gray-900">
                  {avgConversionRate.toFixed(1)}%
                </p>
                <p className="text-xs text-gray-400 mt-1">
                  Average across forms
                </p>
              </div>
              <div className="bg-purple-100 p-3 rounded-lg">
                <TrendingUp className="h-8 w-8 text-purple-600" />
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Recent Activity & Quick Actions */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Recent Activity */}
        <div className="lg:col-span-2">
          <div className="card">
            <div className="card-header">
              <div className="flex items-center justify-between">
                <h3 className="text-lg font-medium text-gray-900 flex items-center">
                  <Activity className="h-5 w-5 mr-2" />
                  Recent Activity
                </h3>
                <Link
                  to="/dashboard"
                  className="text-sm text-primary-600 hover:text-primary-500"
                >
                  View all
                </Link>
              </div>
            </div>
            <div className="card-body p-0">
              {recentActivity.length > 0 ? (
                <div className="divide-y divide-gray-200">
                  {recentActivity.map((form) => (
                    <div
                      key={form._id}
                      className="p-4 hover:bg-gray-50 transition-colors"
                    >
                      <div className="flex items-center justify-between">
                        <div className="flex items-start space-x-3">
                          {getFormStatusIcon(form)}
                          <div className="flex-1 min-w-0">
                            <Link
                              to={`/forms/${form._id}/edit`}
                              className="text-sm font-medium text-gray-900 hover:text-primary-600 truncate block"
                            >
                              {form.title}
                            </Link>
                            <p className="text-xs text-gray-500 mt-1">
                              Updated{" "}
                              {formatDistanceToNow(new Date(form.updatedAt), {
                                addSuffix: true,
                              })}
                            </p>
                            <div className="flex items-center space-x-4 mt-2">
                              <span className="text-xs text-gray-400">
                                {form.stats?.totalViews || 0} views
                              </span>
                              <span className="text-xs text-gray-400">
                                {form.stats?.totalSubmissions || 0} submissions
                              </span>
                            </div>
                          </div>
                        </div>
                        <div className="flex items-center space-x-2">
                          {getStatusBadge(form)}
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              ) : (
                <div className="p-8 text-center">
                  <Activity className="mx-auto h-8 w-8 text-gray-400 mb-2" />
                  <p className="text-gray-500">No recent activity</p>
                </div>
              )}
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="space-y-6">
          <div className="card">
            <div className="card-header">
              <h3 className="text-lg font-medium text-gray-900 flex items-center">
                <Zap className="h-5 w-5 mr-2" />
                Quick Actions
              </h3>
            </div>
            <div className="card-body space-y-3">
              <Link
                to="/forms/new"
                className="w-full btn btn-primary justify-start"
              >
                <Plus className="h-4 w-4 mr-2" />
                Create New Form
              </Link>
              <button
                onClick={() => window.open("https://airtable.com", "_blank")}
                className="w-full btn btn-secondary justify-start"
              >
                <ExternalLink className="h-4 w-4 mr-2" />
                Open Airtable
              </button>
              <Link
                to="/settings"
                className="w-full btn btn-secondary justify-start"
              >
                <Settings className="h-4 w-4 mr-2" />
                Account Settings
              </Link>
            </div>
          </div>

          {/* Tips */}
          <div className="card bg-gradient-to-br from-blue-50 to-indigo-50 border-blue-200">
            <div className="card-header border-blue-200">
              <h3 className="text-lg font-medium text-blue-900">💡 Pro Tips</h3>
            </div>
            <div className="card-body">
              <ul className="text-sm text-blue-800 space-y-2">
                <li>• Use conditional logic to create dynamic forms</li>
                <li>• Test your forms before publishing</li>
                <li>• Monitor analytics to optimize conversions</li>
                <li>• Export responses for further analysis</li>
              </ul>
            </div>
          </div>
        </div>
      </div>

      {/* Forms Section */}
      <div className="card">
        <div className="card-header">
          <div className="flex flex-col lg:flex-row lg:items-center lg:justify-between space-y-4 lg:space-y-0">
            <div>
              <h2 className="text-xl font-semibold text-gray-900">
                Your Forms
              </h2>
              <p className="text-sm text-gray-500 mt-1">
                Manage and track your form collection
              </p>
