  function renderShareModal() {
    if (!showShareModal || !selectedForm) return null;

    const shareUrl = `${window.location.origin}/form/${selectedForm._id}`;
    const embedCode = `<iframe src="${window.location.origin}/embed/${selectedForm._id}" width="100%" height="600" frameborder="0"></iframe>`;

    return (
      <div className="fixed inset-0 z-50 overflow-y-auto">
        <div className="flex items-end justify-center min-h-screen pt-4 px-4 pb-20 text-center sm:block sm:p-0">
          <div
            className="fixed inset-0 bg-gray-500 bg-opacity-75 transition-opacity"
            onClick={() => setShowShareModal(false)}
          />

          <div className="inline-block align-bottom bg-white rounded-lg text-left overflow-hidden shadow-xl transform transition-all sm:my-8 sm:align-middle sm:max-w-2xl sm:w-full">
            <div className="bg-white px-4 pt-5 pb-4 sm:p-6">
