                <h3 className="text-lg leading-6 font-medium text-gray-900">
                  Share Form: {selectedForm.title}
                </h3>
                <button
                  onClick={() => setShowShareModal(false)}
                  className="text-gray-400 hover:text-gray-600"
                >
                  <X className="h-6 w-6" />
                </button>
              </div>

              <div className="space-y-6">
                {/* Share Link */}
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Share Link
                  </label>
                  <div className="flex">
                    <input
                      type="text"
                      className="input flex-1 rounded-r-none"
                      value={shareUrl}
                      readOnly
                    />
                    <button
                      onClick={() => copyShareLink(selectedForm)}
                      className="btn btn-primary rounded-l-none"
                    >
                      Copy
                    </button>
                  </div>
                  <p className="text-xs text-gray-500 mt-1">
                    Anyone with this link can access your form
                  </p>
                </div>

                {/* Embed Code */}
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Embed Code
                  </label>
                  <div className="relative">
                    <textarea
                      className="textarea font-mono text-xs"
                      value={embedCode}
                      readOnly
                      rows={3}
                    />
                    <button
                      onClick={async () => {
                        try {
                          await navigator.clipboard.writeText(embedCode);
                          toast.success("Embed code copied!");
                        } catch (error) {
                          toast.error("Failed to copy embed code");
                        }
                      }}
                      className="absolute top-2 right-2 btn btn-sm btn-secondary"
                    >
                      Copy
                    </button>
                  </div>
                  <p className="text-xs text-gray-500 mt-1">
                    Embed this form directly on your website
                  </p>
                </div>

                {/* Social Sharing */}
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Share on Social Media
                  </label>
                  <div className="flex space-x-2">
                    <button
                      onClick={() =>
                        window.open(
                          `https://twitter.com/intent/tweet?url=${encodeURIComponent(
                            shareUrl
                          )}&text=${encodeURIComponent(
                            `Check out this form: ${selectedForm.title}`
                          )}`
                        )
                      }
                      className="btn btn-secondary flex-1"
                    >
                      Twitter
                    </button>
                    <button
                      onClick={() =>
                        window.open(
                          `https://www.facebook.com/sharer/sharer.php?u=${encodeURIComponent(
                            shareUrl
                          )}`
                        )
                      }
                      className="btn btn-secondary flex-1"
                    >
                      Facebook
                    </button>
                    <button
                      onClick={() =>
                        window.open(
                          `https://www.linkedin.com/sharing/share-offsite/?url=${encodeURIComponent(
                            shareUrl
                          )}`
                        )
                      }
                      className="btn btn-secondary flex-1"
                    >
                      LinkedIn
                    </button>
                  </div>
                </div>

                {/* Form Status */}
                <div className="bg-gray-50 rounded-lg p-4">
                  <div className="flex items-center justify-between">
                    <div>
                      <p className="text-sm font-medium text-gray-900">
                        Form Status
                      </p>
                      <p className="text-xs text-gray-500">
                        {selectedForm.isPublished && selectedForm.isActive
                          ? "Your form is live and accepting responses"
                          : "Your form is not published yet"}
                      </p>
                    </div>
                    {getStatusBadge(selectedForm)}
                  </div>
                  {!selectedForm.isPublished && (
                    <button
                      onClick={() => {
                        handlePublishToggle(selectedForm);
                        setShowShareModal(false);
                      }}
                      className="btn btn-primary btn-sm mt-2"
                    >
                      Publish Form
                    </button>
                  )}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
};

