                {form.stats?.conversionRate || 0}%
              </td>
              <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                {format(new Date(form.updatedAt), "MMM d, yyyy")}
              </td>
              <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                <div className="flex items-center justify-end space-x-2">
                  {/* Quick Actions */}
                  {form.isPublished && (
                    <button
                      onClick={() => onView(form)}
                      className="text-gray-400 hover:text-blue-600 transition-colors"
                      title="View Form"
                    >
                      <ExternalLink className="h-4 w-4" />
                    </button>
                  )}

                  <button
                    onClick={() => onEdit(form)}
                    className="text-gray-400 hover:text-primary-600 transition-colors"
                    title="Edit Form"
                  >
                    <Edit3 className="h-4 w-4" />
                  </button>

                  <button
                    onClick={() => onAnalytics(form)}
                    className="text-gray-400 hover:text-purple-600 transition-colors"
                    title="View Analytics"
                  >
                    <BarChart3 className="h-4 w-4" />
                  </button>

                  <button
                    onClick={() => onResponses(form)}
                    className="text-gray-400 hover:text-green-600 transition-colors"
                    title="View Responses"
                  >
                    <Users className="h-4 w-4" />
                  </button>

                  {/* More Actions Dropdown */}
                  <div className="relative group">
                    <button className="text-gray-400 hover:text-gray-600 transition-colors">
                      <MoreVertical className="h-4 w-4" />
                    </button>
                    <div className="absolute right-0 top-6 w-48 bg-white rounded-md shadow-lg border border-gray-200 py-1 z-10 opacity-0 invisible group-hover:opacity-100 group-hover:visible transition-all duration-200">
                      <button
                        onClick={() => onShare(form)}
                        className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50"
                      >
                        <Share2 className="h-4 w-4 inline mr-2" />
                        Share
                      </button>
                      <button
                        onClick={() => onPublishToggle(form)}
                        className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50"
                      >
                        <Globe className="h-4 w-4 inline mr-2" />
                        {form.isPublished ? "Unpublish" : "Publish"}
                      </button>
                      <button
                        onClick={() => onDuplicate(form)}
                        className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50"
                      >
                        <Copy className="h-4 w-4 inline mr-2" />
                        Duplicate
                      </button>
                      <div className="relative group/export">
                        <button className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50">
                          <Download className="h-4 w-4 inline mr-2" />
                          Export Responses
                        </button>
                        <div className="absolute left-full top-0 w-28 bg-white rounded-md shadow-lg border border-gray-200 py-1 ml-1 opacity-0 invisible group-hover/export:opacity-100 group-hover/export:visible transition-all">
                          <button
                            onClick={() => onExport(form._id, "csv")}
                            disabled={isExporting}
                            className="block w-full text-left px-3 py-1 text-xs text-gray-700 hover:bg-gray-50 disabled:opacity-50"
                          >
                            CSV
                          </button>
                          <button
                            onClick={() => onExport(form._id, "json")}
                            disabled={isExporting}
                            className="block w-full text-left px-3 py-1 text-xs text-gray-700 hover:bg-gray-50 disabled:opacity-50"
                          >
                            JSON
                          </button>
                        </div>
                      </div>
                      <hr className="my-1" />
                      <button
                        onClick={() => onDelete(form)}
                        className="block w-full text-left px-4 py-2 text-sm text-red-600 hover:bg-red-50"
                      >
                        <Trash2 className="h-4 w-4 inline mr-2" />
                        Delete
                      </button>
                    </div>
                  </div>
                </div>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;

function renderDuplicateModal() {
  if (!showDuplicateModal) return null;

  return (
    <div className="fixed inset-0 z-50 overflow-y-auto">
      <div className="flex items-end justify-center min-h-screen pt-4 px-4 pb-20 text-center sm:block sm:p-0">
        <div
          className="fixed inset-0 bg-gray-500 bg-opacity-75 transition-opacity"
          onClick={() => setShowDuplicateModal(false)}
        />

        <div className="inline-block align-bottom bg-white rounded-lg text-left overflow-hidden shadow-xl transform transition-all sm:my-8 sm:align-middle sm:max-w-lg sm:w-full">
          <div className="bg-white px-4 pt-5 pb-4 sm:p-6 sm:pb-4">
            <div className="sm:flex sm:items-start">
              <div className="mx-auto flex-shrink-0 flex items-center justify-center h-12 w-12 rounded-full bg-primary-100 sm:mx-0 sm:h-10 sm:w-10">
                <Copy className="h-6 w-6 text-primary-600" />
              </div>
              <div className="mt-3 text-center sm:mt-0 sm:ml-4 sm:text-left w-full">
                <h3 className="text-lg leading-6 font-medium text-gray-900">
                  Duplicate Form
                </h3>
                <div className="mt-2">
                  <p className="text-sm text-gray-500 mb-4">
                    Create a copy of <strong>"{selectedForm?.title}"</strong>{" "}
                    with all its settings and fields.
                  </p>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      New Form Title
                    </label>
                    <input
                      type="text"
                      className="input w-full"
                      value={duplicateTitle}
                      onChange={(e) => setDuplicateTitle(e.target.value)}
                      placeholder="Enter new form title"
                      autoFocus
                    />
                    {duplicateTitle.trim() && (
                      <p className="text-xs text-gray-500 mt-1">
                        Preview: {duplicateTitle}
                      </p>
                    )}
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div className="bg-gray-50 px-4 py-3 sm:px-6 sm:flex sm:flex-row-reverse">
            <button
              type="button"
              className="w-full inline-flex justify-center rounded-md border border-transparent shadow-sm px-4 py-2 bg-primary-600 text-base font-medium text-white hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 sm:ml-3 sm:w-auto sm:text-sm disabled:opacity-50 disabled:cursor-not-allowed"
              onClick={handleDuplicateForm}
              disabled={!duplicateTitle.trim() || loading}
            >
              {loading ? (
                <>
                  <LoadingSpinner size="sm" color="white" className="mr-2" />
                  Duplicating...
                </>
              ) : (
                <>
                  <Copy className="h-4 w-4 mr-2" />
                  Duplicate Form
                </>
              )}
            </button>
            <button
              type="button"
              className="mt-3 w-full inline-flex justify-center rounded-md border border-gray-300 shadow-sm px-4 py-2 bg-white text-base font-medium text-gray-700 hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 sm:mt-0 sm:ml-3 sm:w-auto sm:text-sm"
              onClick={() => {
                setShowDuplicateModal(false);
                setDuplicateTitle("");
              }}
              disabled={loading}
            >
              Cancel
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
